import './App.css';
import Sidebar from "./Sidebar";
import Chat from "./Chat";
import { Switch } from '@material-ui/core';


function App() {
  return (
    <div className="App">

      <div className="app__body">
      <Router>
        <Switch>
          <Route path="/">
            <h1>Home screen</h1>
          </Route>
          <Sidebar/>
          <Chat/>
        </Switch>
      </Router>

      </div>
    </div>
  );
}

export default App;
